const Card = () => {
  return (
    <div>
      <div className="container">
        <div className="img">
            <img src="../Assest/image/taj.png" alt="" />
        </div>
        <div className="text1">
            <div></div>
            <div></div>
        </div>
        <div className="text2"></div>
        <div className="rs"></div>
      </div>
    </div>
  );
};

export default Card;
